DESCRIPTION:
Neteisėtai, pažeidžiant[duomenys nuasmeninti]5, 150.10 punktus priparkuotas automobilis. Automobilis stovi ant šaligatvio dalies ir trukdo kitų eismo dalyvių eismui tiek šaligatviu, tiek važiuojamąja dalimi.

150.5. ant vejos, šaligatvio (išskyrus tuos atvejus, kai ten stovėti leidžia stovėjimo būdą nurodantys kelio ženklai arba transporto priemonė nurodyta leidime, išduotame prekiauti viešoje vietoje renginių metu), taip pat sporto, vaikų žaidimo aikštelėse ir kitose transporto priemonių eismui (stovėjimui) neskirtose teritorijose;

150.10. ten, kur sustojusi transporto priemonė užstotų kitiems vairuotojams šviesoforo signalus ar kelio ženklus, trukdytų įvažiuoti (išvažiuoti) į (iš) stovėjimo aikštelę (-ės), stovėjimo vietą (-os), garažą (-o), kiemą (-o), teritoriją (-os), trukdytų įlipti į kitą transporto priemonę arba kitaip kliudytų transporto priemonių ar pėsčiųjų eismui;<br>Pažeidimo data ir laikas: 2020-10-07 20:00<br>Automobilio valst. nr.:[duomenys nuasmeninti]

